import React from "react";
import { Navbar, NavbarBrand, Container } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebookF } from "@fortawesome/free-brands-svg-icons";
import { faLinkedin } from "@fortawesome/free-brands-svg-icons";
import { faInstagram } from "@fortawesome/free-brands-svg-icons";

class Footer extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="fixed-bottom bg-light d-flex justify-content-center">
          <Navbar color="dark" dark>
            <Container>
              <NavbarBrand className="h6 small">
                Desarrollado por Mart√≠n Madridejos
              </NavbarBrand>
              
              <FontAwesomeIcon className="mr-3" icon={faFacebookF} />
              <FontAwesomeIcon className="mr-3" icon={faInstagram} />
              <FontAwesomeIcon className="mr-3" icon={faLinkedin} />
            </Container>
          </Navbar>
        </div>
      </React.Fragment>
    );
  }
}

export default Footer;
